const Nav = () => {
    const handleClick = () =>{
        //ir a la seccion.
    }
  return(
        <ul className="navbar">
            <li className="navbar-item"><a onClick={handleClick}>Fotos</a></li>
            <li className="navbar-item"><a onClick={handleClick}>Ubicacion</a></li>
            <li className="navbar-item"><a onClick={handleClick}>Contacto</a></li>
        </ul>)
    }
const Title = ({title}) =>{
    return <h1 className="title animate__animated animate__fadeInRight">{title}</h1>
}

const Welcome = () => {
    return (
        <>
        <Title title={'Bienvenidos!'}/>
        <p className="text">El departamento se encuentra ubicado dentro del complejo Apartamentos Valeria del Mar. A solo 150metros de la playa y a 450metros del centro comercial.</p>
        <p className="text">Cuenta con dos amplios ambientes,y un balcon con parrilla propia</p>
        <p className="text">Gran parque dentro del complejo, con sillas, sombrillas, reposera, piletas y parrillas</p>
        <p className="text">Ademas, el departamento cuenta con servicio de Wi-Fi y lavarropas</p>
        </>
    )
}


const Pictures = () => {
    return( 
        <div className="img-container">
            <Picture src={'/images/complejo-frente.jpg'}/>
            <Picture src={'/images/complejo-pileta.JPG'}/>
            <Picture src={'/images/complejo-jardin.JPG'}/>
        </div>
    )
}

const Picture = ({description,src}) => {
    return (<>
            <img className="img animate__animated animate__fadeInRight" src={src}></img>
            <span>{description}</span>
            </>
        )
}

const Map = () =>{
    return (
        <div className="container">
            <div className="text-container">
            <Title title={'Ubicacion'}/>
            <p className="text">A solo 150 metros de la playa y a 450 metros del centro comercial</p>
            </div>
        <iframe src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3180.4992400644715!2d-56.87708979351423!3d-37.140826971317246!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x959c9daeb64d72d3%3A0x7618f66397e31da!2sComplejo%20Ostra%20Negra!5e0!3m2!1ses-419!2sar!4v1676655116575!5m2!1ses-419!2sar" width="600" height="450" className="map" allowFullScreen="" loading="lazy" referrerPolicy="no-referrer-when-downgrade"></iframe>
        </div>
    )
}
const Available = () =>{
  return  <>
    <Title title={"Disponibilidad"}/>
    <hr></hr>
    <p className="text">Alquilamos por semanas o por quincenas. Contactarse para conocer la disponibilidad y los precios!</p>
    </>
}

const Contact = () =>{
   return <>
    <span>Celular: 011-5122-7269 o 011-3760-8054</span>
    <span>Mail: ejaisa1963@yahoo.com.ar</span>
    </>
}

const Main = () => {
    return <>
        <Welcome/>
        <Pictures/>
        <Map/>
        <Available/>
        </>
}


const Footer = () => {
   return  <Contact/>
}


export const Body = () => {
    return (
        <div className='body'>
        <Nav/>
        <Main/>
        <Footer/>
        </div>
    )
}
